    [],nt"num_tags": 8,nt"name": "wildlife-inventory-plan-seney-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "The Wildlife Inventory Plan is the guideline
    employed to obtain useful parameters related to the distribution, abundance, and
    population dynamics of wildlife species inhabiting refuge lands. These data are
    required to develop management recommendations appropriate to the objectives of
    the refuge and National Wildlife Refuge System in general. The objectives of the
    Inventory Plan are as follows: (1) to obtain in accordance with acceptable wildlife
     management techniques the best possible estimates of wildlife population parameters
    commensurate with the objectives of such investigation and the time, resources,
    and personnel available; (2) to obtain concomitant data on the accuracy of estimates
    obtained, i.e., data on the sufficiency of assumptions  and the effect of sampling
    error; and (3) to record, make available such data for purposes of species, population,
    and refuge management, and for other  purposes.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
